import classes from './ShowSearchedMovie.module.css';

const ShowSearchedMovie= props=>{
    return(
        <div className={classes}>
            
                <h2>{props.title}</h2>
                <span>{props.description}</span>
                <img style={{ height:"220px", width:"241px" }}src={props.image} alt="" />

        </div >
    );
};

export default ShowSearchedMovie;
